var prefs;
var body = $("body").html();

var loadPreferences = function(){
  var accName = 'metric_preferences';
  var selected_value;

  chrome.storage.sync.get(accName, function(data){
    var val = data[accName];
    if(!val){
      prefs = loadDefaults();
    } else {
      prefs = val;
    }
    // identifyAndUpdatePageUnits();
    applyConversions();
  });
};

var unitMeasures = function(unitName){
	var lookup = getUnitLookup(unitName);
	if(lookup){
		return lookup.measures;
	}
	alert("No associated measure found for "+unitName);
  return null;
};

var getUnitLookup = function(unitName){
	for(var j=0; j<lookups.length; j++){
		var lookup = lookups[j];
		if(lookup.unit == unitName){
			return lookup;
		}
	}
  alert("No unit found for "+unitName);
	return null;	
};

var getPreferenceFor = function(type){  
	for(var k=0; k<prefs.length;k++){
		if(prefs[k].measures == type){
			return prefs[k].preference;
		}
	}
  alert(type+" has no Preference set");
	return null;
};

var loadDefaults = function(){
	return [
	   {'measures': 'length', 'preference': 'meter'},
	   {'measures': 'area', 'preference': 'square meter'},
	   {'measures': 'volume', 'preference': 'liter'},
	   {'measures': 'weight', 'preference': 'kilogram'},
	   {'measures': 'time', 'preference': 'second'},
	   {'measures': 'temperature', 'preference': 'celsius'},
	   {'measures': 'speed', 'preference': 'meters per second'}
	 ];
};

var convert = function(valueToBeConverted, unit, toBeConvertedTo){

	//normalise to SI unit

	//Take normalised value and convert to new lookup value
	// Formula:
	//Subtract offset 
	//multiply by factor
  
  var toBase = unit.convert_to_base_factor;
  var toPremult = parseFloat(toBase.conversion_factor_premult);
  var toConversionFactorOffset = parseFloat(toBase.conversion_factor_offset);
  var toConversionFactor = parseFloat(toBase.conversion_factor);
  var toConversionFactorExponent = parseFloat(toBase.conversion_factor_exponent);

  var fromBase = toBeConvertedTo.convert_to_base_factor;
  var fromPremult = parseFloat(fromBase.conversion_factor_premult);
  var fromConversionFactorOffset = parseFloat(fromBase.conversion_factor_offset);
  var fromConversionFactor = parseFloat(fromBase.conversion_factor);
  var fromConversionFactorExponent = parseFloat(fromBase.conversion_factor_exponent);

  // var baseValue = ( toPremult * (valueToBeConverted - toConversionFactorOffset)) * (toConversionFactor * Math.pow(10,toConversionFactorExponent));
  // var convertedValue = ((baseValue + fromConversionFactorOffset) / fromPremult) / power(fromConversionFactor, (fromConversionFactorExponent * -1));

  var baseValue = (toPremult * (valueToBeConverted - toConversionFactorOffset)) * (toConversionFactor * Math.pow(10,(toConversionFactorExponent * -1)));
  //baseValue is number of units as a base unit
  // var convertedValue = (baseValue/ (fromConversionFactor * Math.pow(10,(fromConversionFactorExponent)) + fromConversionFactorOffset) / fromPremult);
  var convertedValue = baseValue * (fromConversionFactor * Math.pow(10,(fromConversionFactorExponent)));

	return convertedValue;
};


